var queryURL = "https://icanhazdadjoke.com/";


export const getJokes = () => {
    fetch(queryURL,{
        method:"GET",
        headers:{
            "Accept": "application/json"
        }
    })
    .then(res => {
        // console.log(res.json())
        return res.json()
    })
    .catch(err => {
        console.log(err)
    })
};
